from typing import * 

class Solution:
    def nextToVisit(self, pn:tuple, points:set):
        x,y = pn 
        next2visit =  set(p for p in [(x,y-1), (x,y+1), (x-1,y), (x+1,y)] if p in points)
        points -= next2visit
        return next2visit

    def numIslands(self, grid: List[List[str]]) -> int:
        m = len(grid)
        n = len(grid[0])
        points = set([(i,j) for i in range(m) for j in range(n) if grid[i][j]=="1"])
        islandCount = 0
        while points:
            p = points.pop()
            islandCount +=1
            visitNext = self.nextToVisit(p, points)
            while visitNext:
                pn = visitNext.pop()
                n2v = self.nextToVisit(pn, points)                
                visitNext = visitNext.union(n2v)

        return islandCount
    

